import React, { Component } from 'react';
import 'materialize-css/dist/css/materialize.min.css';
import './pagination.css';

class Pagination extends Component {
    constructor() {
        super();
        this.state = {
            currentPage: 1,
        }
    }
    changePage() {

    }
    render() {
        const { currentPage } = this.state;
        console.log(this.props);
        return (
            <ul className="pagination">
                <li className={currentPage === 1 ? 'disabled' : ''}><a href="#!" onClick={this.changePage()}><i className="material-icons">chevron_left</i></a> Previous</li>
                <li className="waves-effect"><a href="#!" onClick={this.changePage()}>Next <i className="material-icons">chevron_right</i></a></li>
            </ul>
        );
    }
}

export default Pagination;
